import React from "react";
import "./userProfile.css";
import NavBar from '../navbar/navBar';

function homePage(){
    return(
        <React.Fragment>
            <NavBar />
            <div class="jumbotron center">
                <div class="container">
                    <h1 class="display-3">Welcome User</h1>
                    <p>Welcome to your profile
                    </p>
                </div>
            </div>
        </React.Fragment>
    )
}

export default homePage;
